import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';

// dashboard components
import { LayoutComponent } from './dashboard/layout/layout.component';
import { TopBarComponent } from './dashboard/top-bar/top-bar.component';
import { OverlayComponent } from './dashboard/overlay/overlay.component';
import { SidebarComponent } from './dashboard/sidebar/sidebar/sidebar.component';
import { SidebarItemComponent } from './dashboard/sidebar/sidebar-item/sidebar-item.component';
import { SidebarItemsComponent } from './dashboard/sidebar/sidebar-items/sidebar-items.component';
import { SidebarHeaderComponent } from './dashboard/sidebar/sidebar-header/sidebar-header.component';

// pages
import { HomeComponent } from './pages/home/home.component';
import { CreditComponent } from './pages/credit/credit.component';
import { StatusComponent } from './pages/status/status.component';
import { ArchiveComponent } from './pages/archive/archive.component';
import { SettingsComponent } from './pages/settings/settings.component';
import { DocIconComponent } from './dashboard/icons/doc-icon/doc-icon.component';
import { DocumentationComponent } from './pages/documentation/documentation.component';

// icons
import { HomeIconComponent } from './dashboard/icons/home-icon/home-icon.component';
import { CreditIconComponent } from './dashboard/icons/credit-icon/credit-icon.component';
import { StatusIconComponent } from './dashboard/icons/status-icon/status-icon.component';
import { ArchiveIconComponent } from './dashboard/icons/archive-icon/archive-icon.component';
import { SettingsIconComponent } from './dashboard/icons/settings-icon/settings-icon.component';
import { FormsModule } from '@angular/forms'; 

// others
import { DocComponent } from './components/docs/doc/doc.component';
import { ContentComponent } from './components/content/content.component';
import { SnippetComponent } from './components/docs/snippet/snippet.component';
import { FolderIconComponent } from './components/docs/icons/folder-icon/folder-icon.component';
import { AngularIconComponent } from './components/docs/icons/angular-icon/angular-icon.component';
import { HttpClientModule, provideHttpClient } from '@angular/common/http';
import { ListUserComponent } from './pages/list-user/list-user.component';
import { LoginComponent } from './pages/login/login.component';
import { ListPatientComponent } from './pages/list-patient/list-patient.component';
import { SddiagnosticComponent } from './pages/sddiagnostic/sddiagnostic.component';
import { CartetransfComponent } from './pages/cartetransf/cartetransf.component';
import { ComplicationcoeurComponent } from './pages/complicationcoeur/complicationcoeur.component';
import { IrmcoeurComponent } from './pages/irmcoeur/irmcoeur.component';
import { CompfoieComponent } from './pages/compfoie/compfoie.component';
import { IrmfoieComponent } from './pages/irmfoie/irmfoie.component';
import { GlucidiqueComponent } from './pages/glucidique/glucidique.component';
import { DevpubComponent } from './pages/devpub/devpub.component';
import { ThyroideComponent } from './pages/thyroide/thyroide.component';
import { SurrenalineComponent } from './pages/surrenaline/surrenaline.component';
import { OsComponent } from './pages/os/os.component';
import { CriseComponent } from './pages/crise/crise.component';
import { ThoraciqueComponent } from './pages/thoracique/thoracique.component';
import { AvcComponent } from './pages/avc/avc.component';
import { AgComponent } from './pages/ag/ag.component';
import { InfostComponent } from './pages/infost/infost.component';
import { PulmonaireComponent } from './pages/pulmonaire/pulmonaire.component';
import { MeningiteComponent } from './pages/meningite/meningite.component';
import { AutreinfComponent } from './pages/autreinf/autreinf.component';
import { PriapismeComponent } from './pages/priapisme/priapisme.component';
import { ThromboseretineComponent } from './pages/thromboseretine/thromboseretine.component';

@NgModule({
  declarations: [
    AppComponent,

    // dashboard
    LayoutComponent,
    TopBarComponent,
    OverlayComponent,
    SidebarComponent,
    SidebarItemComponent,
    SidebarItemsComponent,
    SidebarHeaderComponent,

    // pages
    HomeComponent,
    CreditComponent,
    StatusComponent,
    ArchiveComponent,
    SettingsComponent,
    DocumentationComponent,

    // icons
    DocIconComponent,
    HomeIconComponent,
    ArchiveIconComponent,
    CreditIconComponent,
    StatusIconComponent,
    SettingsIconComponent,

    // others
    DocComponent,
    SnippetComponent,
    ContentComponent,
    FolderIconComponent,
    AngularIconComponent,
    ListUserComponent,
    LoginComponent,
    ListPatientComponent,
    SddiagnosticComponent,
    CartetransfComponent,
    ComplicationcoeurComponent,
    IrmcoeurComponent,
    CompfoieComponent,
    IrmfoieComponent,
    GlucidiqueComponent,
    DevpubComponent,
    ThyroideComponent,
    SurrenalineComponent,
    OsComponent,
    CriseComponent,
    ThoraciqueComponent,
    AvcComponent,
    AgComponent,
    InfostComponent,
    PulmonaireComponent,
    MeningiteComponent,
    AutreinfComponent,
    PriapismeComponent,
    ThromboseretineComponent,
   
  ],
  imports: [BrowserModule, AppRoutingModule,FormsModule ,HttpClientModule,],
  providers: [    provideHttpClient()  ],
  bootstrap: [AppComponent],
})
export class AppModule {}
